import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import '../styles/HomePage.css';

const HomePage = ({ labs }) => {
  const [loading, setLoading] = useState(true);
  const [stats, setStats] = useState({});

  // Simulate data fetching for lab stats
  useEffect(() => {
    const fetchLabStats = async () => {
      try {
        // Simulate API call delay
        await new Promise(resolve => setTimeout(resolve, 800));

        // TODO: Replace with actual API calls
        // const statsResponse = await fetch('/api/labs/stats');
        // const statsData = await statsResponse.json();

        // Mock data - generate random stats for each lab
        const mockStats = {};
        labs.forEach(lab => {
          const working = Math.floor(Math.random() * lab.totalComputers);
          mockStats[lab.id] = {
            working,
            nonWorking: lab.totalComputers - working,
            lastUpdated: new Date().toLocaleTimeString()
          };
        });

        setStats(mockStats);
      } catch (error) {
        console.error('Error fetching lab statistics:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchLabStats();

    // Set up polling to refresh stats every 30 seconds
    const intervalId = setInterval(fetchLabStats, 30000);

    return () => clearInterval(intervalId);
  }, [labs]);

  if (loading) {
    return (
      <div className="home-container">
        <h1>Lab Management System</h1>
        <div className="loading-container">
          <div className="spinner"></div>
          <p>Loading labs...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="home-container">
      <header className="page-header">
        <h1>Lab Management System</h1>
        <p className="page-subtitle">Select a lab to view its status and manage computers</p>
      </header>
      <div className="labs-grid">
        {labs.map((lab) => {
          const labStats = stats[lab.id] || { working: 0, nonWorking: 0 };
          const workingPercentage = lab.totalComputers > 0 
            ? Math.round((labStats.working / lab.totalComputers) * 100) 
            : 0;

          return (
            <Link 
              to={`/lab/${lab.id}`} 
              key={lab.id} 
              className="lab-card"
              aria-label={`View ${lab.name} details`}
            >
              <div className="lab-card-header">
                <h2>{lab.name}</h2>
                <span className="lab-status">
                  <span className={`status-dot ${workingPercentage > 80 ? 'excellent' : workingPercentage > 50 ? 'good' : 'warning'}`}></span>
                  {workingPercentage}% Operational
                </span>
              </div>

              <div className="lab-stats">
                <div className="stat working">
                  <span className="stat-number">{labStats.working}</span>
                  <span className="stat-label">Working</span>
                </div>
                <div className="stat non-working">
                  <span className="stat-number">{labStats.nonWorking}</span>
                  <span className="stat-label">Needs Attention</span>
                </div>
                <div className="stat total">
                  <span className="stat-number">{lab.totalComputers}</span>
                  <span className="stat-label">Total Computers</span>
                </div>
              </div>

              <div className="progress-bar">
                <div 
                  className="progress-fill working" 
                  style={{ width: `${workingPercentage}%` }}
                  aria-valuenow={workingPercentage}
                  aria-valuemin="0"
                  aria-valuemax="100"
                ></div>
              </div>

              <div className="last-updated">
                Last updated: {labStats.lastUpdated || 'Just now'}
              </div>

              <div className="view-details">
                View Lab Details <span>â†’</span>
              </div>
            </Link>
          );
        })}
      </div>
    </div>
  );
};

export default HomePage;
